import React from 'react';
import './main.css';
import Sidebar from '../sidebar/Sidebar';
import Navbar from '../navbar/Navbar';

function Main() {
  return (
    <div className='page-container'>
      <Navbar />
      <div className='content-wrapper'>
        <Sidebar />
        <div className='main-content'>
          {/* Контент вашего Main */}
        </div>
      </div>
    </div>
  );
}

export default Main;
